post_text:
SWL is excited to be partnering with NBC4i for the Stuff the Backpack Program!

It’s time to #STUFFTHEBACKPACK Southwest Licking Schools!!

@NBC4i is ordering backpacks now for the first day of school- $10 can Stuff 1 Backpack with supplies and $270 can stuff an entire classroom- Donating now at https://www.nbc4i.com/stuff-the-backpack/ and help local students get ready for success! #STUFFJUSTONE

